import React, {Component} from 'react';
import "./assets/css/style.css"
import {Spring, config} from "react-spring/renderprops-universal";
import Header from "./components/headerComponent/Header";



class App extends Component {
    render() {
        return(
            <div>
                <button onClick={() => { this.BG.update()}} style={{position: "absolute", width: 200, height: 200}}>START</button>
                <BG ref={instance => { this.BG = instance}} style={{position: "absolute"}}/>
                <Header/>
            </div>
        );
    }
}

export default App;
